      <p>ИНН: 700 13 123 123</p>
      <p>ОГРНИП: 3213 128388888 1233</p>
      <p>Телефон: 8(999)5441213</p>
      <p>E-mail: info@f8cknonsense.ru</p>
    
    </div>
  );
};

export default Contacts;
